  TableCell,
  TableRow,
  TableFooter,
  TableSortLabel,
  Typography,
} from '@mui/material';
import { DatePicker } from '@mui/x-date-pickers';
import { DateRangePicker } from '@mui/x-date-pickers-pro';

export default function SearchViolations() {
  return (
    <Grid container sx={{ flex: 1, minHeight: 0 }}>
      <Grid size={{ xs: 12 }}>
        <Grid container>
          <Typography size={{ xs: 12, sm: 5 }}>Search Violations</Typography>
        </Grid>
      </Grid>
      <Grid size={{ xs: 12 }}></Grid>
      <Grid size={{ xs: 12 }} sx={{ flex: 1, minHeight: 0 }}></Grid>
    </Grid>
  );
}
